The use of the presence/absence of the S and T setae on the head, the formula for the labial, second and third thoracic segments, second and fourth abdominal segments, and the presence of the accessory seta s of the anterior trichobothrial complex of fourth abdominal segment allows to separate the new species of the considered group. These characters have been selected among others because are easily observed in the specimens. The table 2 , with the 44 characters frequently used for the description of species of this genus, is sufficient to identify and compare the species of this group. These characters have been obtained studying the original papers of the species descriptions (
