Description. Maximum length 0,7-1.0 mm ( Holotype : 0,68 mm). Apparently without pigment. 3 + 3 eyes. Ratio antenna/cephalic diagonal 1,3 and 1,4. Antennal segments I/II/III/IV ratios 1 /1,42/1,29/2,38. Sensorial setae s of the sensory organ of antennal segment III short and expanded (leaf shaped), with two sensilla on antennal segment II (
Fig. 12
). Apical region of the antennal segments II and III, with a pseudopore in an internal-ventral position, far from the setae line. Apical vesicle absent from antennal segment IV.

Unguis (
Fig. 11
) with dental plate occupying 50 % of the basal internal edge; basal teeth of similar size, medial tooth well developed, approximately 65-70 % from base of total unguis. Unguiculus appendage acuminate, always with a first developed external tooth and a second tooth or, sometimes, a more or less slightly developed serrated lamina. Tibiotarsi with clavate tenent hair. Legs without scales. Retinaculum with 4 + 4 teeth and one ciliated seta. Two internal and two to three external setae related to two distal pseudopores of manubrial plate. Mucro with distal tooth equal than the anteapical; the basal spine reaches just to the tip of the first tooth.

Unguis (
Fig. 18
) with dental plate occupying 50 % of the basal internal edge; one of the basal tooth slightly bigger than the other one; medial tooth well developed, approximately 60 % from base of total unguis. Ungual wing tooth present, but very difficult to see in some specimens. Unguiculus appendage acuminate, finely serrated. Tibiotarsi with acuminate tenent hair. Legs without scales. Retinaculum with 4 + 4 teeth and one ciliated seta. Two internal and two to three external setae related to two distal pseudopores of manubrial plate. Mucro with distal tooth longer than the anteapical; the basal spine reaches just to the tip of the distal tooth (
Fig. 19
).

Unguis (
Fig. 25
) with dental plate occupying 60 % of the basal internal edge; one of the basal tooth slightly bigger than the other one; medial tooth well developed, approximately 70 % from base of total unguis. Unguiculus appendage acuminate with small denticles. Dorsal tibiotarsi tenent hair clavate. Legs without scales. Retinaculum with 4 + 4 teeth and one ciliated seta. Two internal and two external setae related to two distal pseudopores of manubrial plate. Mucro with distal tooth longer than the anteapical; the basal spine reaches just to the tip of the distal tooth.
